int
init_eng(int lgno) {

    register int  i;
    unsigned long cid;

    if (eng_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * eng_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * eng_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < eng_MAX_TRIGs; i++) {
           cid = string2id((char *)eng_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = eng_hash[i].prob;
        }
        languages[lgno].wdict = make_dict(2 * 96, 0);
        languages[lgno].whash = (double *)malloc(sizeof(double) * 96);
        for ( i = 0; i < 95; i++) {
           cid = string2id((char *)eng_wordhash[i].word, languages[lgno].wdict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].whash[cid] = eng_wordhash[i].prob;
        }
    } else languages[lgno].used = 0;

    return(0);
}
